import React, {useState} from 'react';
import './Map.css';
import { MapContainer } from 'react-leaflet/MapContainer'
import { TileLayer } from 'react-leaflet/TileLayer'
import { useMap } from 'react-leaflet/hooks'
import {
    Marker, Popup, Polyline, Polygon
} from 'react-leaflet'
import 'leaflet/dist/leaflet.css';


function Map() {
  const encode = require('geojson-polyline').encode
  const n = encode({'bbox':[-121.76321817174035, 38.546501023184646, -121.73167409436275, 38.58325086112612],'type': 'MultiLineString', 'coordinates': [[[-121.73498483802013, 38.54664607633386], [-121.73500331913878, 38.54671122185596]], [[-121.73500331913878, 38.54671122185596], [-121.7350626686529, 38.546920425709516]]]})
  
  const lineColor = (coord1x,coord1y,coord2x,coord2y) => {
    const grey = {color: 'grey'}
    const polyline = [
      [coord1x, coord1y],
      [coord2x, coord2y]
    ]
    return <Polyline pathOptions={grey} positions={n} />
  }
  return ( 
    <div > 

     
      <header className = "header1">
        <div className = "logout">
            Log Out
        </div>
      </header>

      
      <MapContainer className = 'test1' center={[38.5, -121.7]} zoom={9} scrollWheelZoom={false}>
      <TileLayer
    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
    {lineColor(1,1,1,1)}


      
    </MapContainer>
      
      
      

    </div>
  );
}

export default Map;
